import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React from "react";
import { Router } from "react-router-dom";
import "./HeaderSearchBar.css";

const HeaderSearhcBar = () => {
  const goToSearch = () => {
    <Route path="/search" element={<Search />} />;
  };
  return (
    <form className="search-bar" onSubmit={goToSearch}>
      <div>
        <FontAwesomeIcon icon="fa-bed" />
        <input type="text" placeholder="Where are you going?"></input>
      </div>
      <div>
        <FontAwesomeIcon icon="fa-calendar" />
        <input type="date"></input> to <input type="date"></input>
      </div>
      <label>
        <FontAwesomeIcon icon="fa-person" /> 1 adult 0 children 1 room
      </label>
      <button onClick={goToSearch} formTarget="_blank">
        Search
      </button>
    </form>
  );
};

export default HeaderSearhcBar;
